import { Route } from "react-router-dom";
import DeckList from "./DeckList";

export default function Home() {

    return (
        <div>

            <button to={"./CreateDeck"}>Create Deck</button>

            <Route>
                <DeckList />
            </Route>
        </div>
    )
}
